//! == Import : npm ==
import React from 'react';

//! == Import : local ==
import brand from '../../assets/images/logo-brand.png';
import './styles.scss';

//! == Composant ==
const Login = () => (
    <div className="login">
        <form className="login__form">
            <img src={brand} alt="brand" className="login__brand"/>
            <input type="email" className="login__email"/>
            <input type="password" className="login__password"/>
        </form>
    </div>
);

//! == Export ==
export default Login;
